function Footer() {
    return(


        <footer class="bg-gray-50">
            <hr class="my-6 border-gray-200 sm:mx-auto dark:border-gray-700 lg:my-8" />
            <div class="sm:flex sm:items-center sm:justify-between">
                <span class="text-sm text-gray-500 sm:text-center dark:text-gray-400">© 2023 <a href="https://romain-gilot.fr/" class="hover:underline">Romain GILOT</a>. Tous droits réservés.
                </span>
            </div>
        </footer>

    )
}

export default Footer
